import React from 'react'



function HaikuScore(id) {
    var haiku = JSON.parse(localStorage.getItem("haikus"));
    haiku['name'] = "boi";
    localStorage.setItem("haikus", JSON.stringify(haiku))

}
export default HaikuScore
